static int RadToId(float fltRad)
{
    return (int)(fltRad * (8192.0f / (0.01745329251994329576f * 360.0f))) & 8191;
}

static float sinfCl(float fltRad)
{
    return s_STable[ RadToId(fltRad) ];
}

static float cosfCl(float fltRad)
{
    return s_CTable[ RadToId(fltRad) ];
}


