/*
   Render icons.

   Parameters:
   Dev        - D2D device structure
 */
static void locRenderElements(davehd_dev_t *Dev)
{
    static uint32_t on_counter = 0;
    const Img_t     *img;
    uint32_t idx;
    int i;
    uint8_t status;
    uint8_t oldstatus;
    uint8_t update;

    /* dhd_uv_data_t   loc_uv; */
    /* float fu, fv; */

    update = 0;
    idx = locFrameCnt % LOC_BUF_NUM;
#if 0
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
    ret |= R_DRW2D_CtxBlendFactors(Dev->drw2d,
                                   R_DRW2D_BLEND_SRC_ALPHA, R_DRW2D_BLEND_ONE_MINUS_SRC_ALPHA,
                                   R_DRW2D_BLEND_ZERO, R_DRW2D_BLEND_ONE);
#endif
    for (i = 0; i < LOC_ELEMENT_NUM - 1; i++) {
        if (locElement[i].GetStatus) {
            status = locElement[i].GetStatus();
        } else {
            status = 1;
        }
        if (locFrameCnt < LOC_BUF_NUM) {
            oldstatus = !status;
        } else {
            oldstatus = locElementOldStatus[i][idx];
        }
        if (status) {
            img = locElement[i].OnImg;
            if (locElement[i].Flags & LOC_ELFLAG_FLASH) {
                if (on_counter > LOC_TURNSIGNAL_FREQ) {
                    img = locElement[i].OffImg;
                    status = 0;
                }
            }
        } else {
            img = locElement[i].OffImg;
        }
        if ((locElement[i].Flags & LOC_ELFLAG_DRAW_ALWAYS)
            || (status != oldstatus)) {
            if (img) {
                if ((locFrameCnt < LOC_BUF_NUM) || (update <= LOC_EL_MAX_UPDATE)
                    || (locElement[i].Flags & LOC_ELFLAG_DRAW_ALWAYS)) {

                    int ret = 0;

                    update++;
                    r_drw2d_Texture_t tmp_tex = demo_img2tex(Dev, img, 0);
                    ret |= R_DRW2D_CtxTextureSet(Dev->drw2d, 0, &tmp_tex);
                    r_drw2d_Rect_t rect = demo_int2rect(locElement[i].PosX, locElement[i].PosY, img->Width, img->Height);
                    ret |= R_DRW2D_TextureBlit(Dev->drw2d, NULL, &rect);

                    if (ret)
                        R_PRINT_Log("error render elements\n");

                } else {
                    status = oldstatus;
                }
            }
        }
        locElementOldStatus[i][idx] = status;
    }
    on_counter++;
    if (on_counter != 1 && on_counter > (2 * LOC_TURNSIGNAL_FREQ)) {
        on_counter = 0;
    }
}

