/*
   Render a needle.

   Parameters:
   Dev        - D2D device structure
   Texture    - Needle image
   ScrCenterX - Center X position on the screen
   ScrCenterY - Center Y position on the screen
   TxtCenterX - Needle rotation point x coordinate
   TxtCenterY - Needle rotation point x coordinate
   Angle      - Angle of the needle
 */
static void locRenderNeedle(davehd_dev_t *Dev, const Img_t *Texture, int ScrCenterX,
                            int ScrCenterY, int TxtCenterX, int TxtCenterY,
                            float Angle)
{
    uint32_t NeedleArrowPosX;
    uint32_t NeedleArrowPosY;
    int ret = 0;
    r_drw2d_LineStyle_t ls;
    r_drw2d_Point_t linePoints[2];

    ls.LineJoin = R_DRW2D_LINEJOIN_NONE;
    ls.LineCap = R_DRW2D_LINECAP_BUTT;
    ls.Width = R_DRW2D_2X(Texture->Height);
    ls.MiterLimit = R_DRW2D_2X(1);
    ls.IsClosed = 0;

    r_drw2d_Texture_t tmp_tex = demo_img2tex(Dev, Texture, R_DRW2D_TEX_PERSPECTIVE | R_DRW2D_TEX_BILINEAR);
    ret |= R_DRW2D_CtxTextureSet(Dev->drw2d, 0, &tmp_tex);
    ret |= R_DRW2D_CtxFillMode(Dev->drw2d, R_DRW2D_FILLMODE_TEXTURE);
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
    /* Needle using premultipled alpha because of bilinear filtering generating color bleeding if not done.
       This will give a black border around the needle */
    ret |= R_DRW2D_CtxBlendFactors(Dev->drw2d,
                                   R_DRW2D_BLEND_ONE, R_DRW2D_BLEND_ONE_MINUS_SRC_ALPHA,
                                   R_DRW2D_BLEND_ZERO, R_DRW2D_BLEND_ONE);
    // locDebugRenderSolidNeedle();
    NeedleArrowPosX = (uint32_t)(cos(Angle * M_PI / 180.0) * (double)Texture->Width + ScrCenterX);
    NeedleArrowPosY = (uint32_t)(-sin(Angle * M_PI / 180.0) * (double)Texture->Width + ScrCenterY);
    linePoints[1].X = R_DRW2D_2X(ScrCenterX);
    linePoints[1].Y = R_DRW2D_2X(ScrCenterY);
    linePoints[0].X = R_DRW2D_2X(NeedleArrowPosX);
    linePoints[0].Y = R_DRW2D_2X(NeedleArrowPosY);
    ret |= R_DRW2D_CtxLineStyle(Dev->drw2d, &ls);
    ret |= R_DRW2D_DrawLines(Dev->drw2d, linePoints, 2);

    if (ret)
        R_PRINT_Log("error render needle\n\n");

}

