/*
   Render a triangle pointer.

   Parameters:
   Dev          - D2D device structure
   Color        - Triangle color
   CenterX      - Center X position on the screen
   CenterY      - Center Y position on the screen
   Size         - Size of the pointer
   TriSize      - Size of the triangle
   Angle        - Angle of the needle
 */
static void locRenderTrianglePointer(davehd_dev_t *Dev, uint32_t Color,
                                     int CenterX, int CenterY,
                                     int Size, int TriSize,
                                     float Angle,
                                     float f32Blur)
{
    float sval;
    float cval;
    float x[3];
    float y[3];
    int ret = 0;

    sval = sinfCl(LOC_DEGREE(Angle));
    cval = cosfCl(LOC_DEGREE(Angle));
    x[0] = (float)CenterX + cval * ((float)Size);
    y[0] = (float)CenterY - sval * ((float)Size);
    sval = sinfCl(LOC_DEGREE(Angle + 30));
    cval = cosfCl(LOC_DEGREE(Angle + 30));
    x[1] = (float)x[0] + cval * ((float)-TriSize);
    y[1] = (float)y[0] - sval * ((float)-TriSize);
    sval = sinfCl(LOC_DEGREE(Angle - 30));
    cval = cosfCl(LOC_DEGREE(Angle - 30));
    x[2] = (float)x[0] + cval * ((float)-TriSize);
    y[2] = (float)y[0] - sval * ((float)-TriSize);

    r_drw2d_Point_t tris[3];
    uint8_t edgeflag;

    tris[0].X = R_DRW2D_2X(x[0]);
    tris[0].Y = R_DRW2D_2X(y[0]);
    tris[1].X = R_DRW2D_2X(x[1]);
    tris[1].Y = R_DRW2D_2X(y[1]);
    tris[2].X = R_DRW2D_2X(x[2]);
    tris[2].Y = R_DRW2D_2X(y[2]);
    edgeflag = (R_DRW2D_EDGE_AB | R_DRW2D_EDGE_BC | R_DRW2D_EDGE_CA);
    ret |= R_DRW2D_CtxFgColor(Dev->drw2d, Color);
    ret |= R_DRW2D_CtxBgColor(Dev->drw2d, Color);
    ret |= R_DRW2D_CtxFillMode(Dev->drw2d, R_DRW2D_FILLMODE_SOLID);
    ret |= R_DRW2D_DrawTriangles(Dev->drw2d, tris, 1, &edgeflag);
    ret |= R_DRW2D_CtxFillMode(Dev->drw2d, R_DRW2D_FILLMODE_TEXTURE);

    if (ret)
        R_PRINT_Log("error render triangle \n");
}

/*
   Convert speed to gauge angle.

   Parameters:
   Speed      - Speed in km/h

   Returns:
   Drawing angle
 */
static float locConvertSpeed2Angle(float Speed)
{
    float angle;

    angle = 180.0f * Speed / 180.0f;    /* 180 km/h are mapped to 180 degree rotation */
    angle = 210.0f - angle;          /* 210 degree is needle zero position */
                                     /* Substract Angle -> Turn CW */
    return angle;
}

static float locFilterGauge(float Old, float New)
{
    float diff;
    float hdiff;

    diff = New - Old;
    if (diff < 0) {
        hdiff = -diff;
    } else {
        hdiff = diff;
    }

    if ((hdiff >= 0) && (hdiff < 1)) {
        Old = New;
    } else {
        if (hdiff > 20) {
            hdiff = 1.25;
        } else if (hdiff > 5) {
            hdiff = 1.0;
        } else {
            hdiff = 0.75;
        }
        if (diff > 0) {
            diff = hdiff;
        } else {
            diff = -hdiff;
        }
        Old += diff;
    }
    return Old;
}

