/*
   Initialize the needle structure

   Parameters:
   Needle     - Pointer to needle structure (refer to GclNeedle_t)
   initAngle  - initial Angle to be set
 */
void locInitNeedlePosition(GclNeedle_t * Needle, float initAngle)
{
    Needle->LastAngleNeedle[1] = initAngle;
    Needle->LastAngleNeedle[0] = initAngle;
    Needle->CurrentAngleNeedle = initAngle;
}

/*
   Sets a new needle angle to the needle structure.
   Updates the older needle angles stored in the needle structure.

   Parameters:
   Needle     - Pointer to needle structure (refer to GclNeedle_t)
   newAngle   - new Angle to be set
 */
void locSetNextNeedlePosition(GclNeedle_t * Needle, float newAngle)
{

    Needle->LastAngleNeedle[1] = Needle->LastAngleNeedle[0];
    Needle->LastAngleNeedle[0] = Needle->CurrentAngleNeedle;
    Needle->CurrentAngleNeedle = newAngle;
}

