/*
   Convert fuel level to gauge angle.

   Parameters:
   Fuel       - Fuel level (0 - 100)

   Returns:   Drawing angle
 */
static float locConvertFuel2Angle(uint8_t Fuel)
{
    float angle;

    angle = 55.0f * (float)Fuel / 100.0f;
    angle = 210.0f - angle;
    return angle;
}

/*
   Fuel gauge render function.

   Parameters:
   Dev        - D2D device structure
 */
static void locFuelRender(davehd_dev_t *Dev)
{
    static float angle = -1;
    float new_angle;
    uint32_t color;
    float f32Blur = 0.3333f;

    /* get fuel needle angle */
    new_angle = CarModelFuelLevelGet();
    color = (int)new_angle;
    new_angle = locConvertFuel2Angle(new_angle);
    if (angle < 0) {
        angle = new_angle;
    } else {
        angle = locFilterGauge(angle, new_angle);
    }

    /* color fade for fuel needle, depends on angle (green to red) */
    color = 0xFF * color / 100;
    color = (0xff << 24) + ((0xFF - (uint8_t)color) << 16) + ((0x00 + (uint8_t)color) << 8) + ((0) << 0);
    locRenderTrianglePointer(Dev, color,
                             LOC_FUEL_CENTERX, LOC_FUEL_CENTERY,
                             LOC_FUEL_SIZE, LOC_FUEL_TRISIZE, angle, f32Blur);
}

/*
   Convert fuel level to gauge angle.

   Parameters:
   Fuel       - Fuel level (0 - 100)

   Returns:   Drawing angle
 */

static float locConvertCooling2Angle(int8_t Temp)
{
    float angle;

    angle = 60.0f * (float)Temp / 100.0f;
    angle = -35.0f + angle;
    return angle;
}

/*
   Fuel gauge render function.

   Parameters:
   Dev        - D2D device structure
 */
static void locCoolingRender(davehd_dev_t *Dev)
{
    static float angle = -1.0f;
    float new_angle;
    int new_temp;
    uint32_t color, index;
    float f32Blur = 0.3333f;

    /* get cooling needle angle */
    new_temp = CarModelCoolingTempGet();
    new_angle = locConvertCooling2Angle(new_temp);
    angle = locFilterGauge(angle, new_angle);

    /* color fade for fuel needle, depends on angle (red to blue) */
    index = 0xFF * new_temp / 100;
    if (index > 0xFF) {
        index = 0xFF;
    }
    color = (0xff << 24) + ((0x0 + index) << 16) + ((0) << 8) + ((0xFF - index) << 0);
    //color = 0xff0000ff;
    locRenderTrianglePointer(Dev, color,
                             LOC_COOLING_CENTERX, LOC_COOLING_CENTERY,
                             LOC_COOLING_SIZE, LOC_COOLING_TRISIZE, angle, f32Blur);
}

