/*
   Restore the Needle background. To be able to restore only the
   pixels that needs to be restored, the angles of the old surface
   that should be restored needs to be given.
   (e.g. the last last angle values for double buffering)

   Parameters:
   Dev               - D2D device structure
   PosX              - horizontal coordinate top left corner of the needle drawing box
   PosY              - vertical coordinate top left corner of the needle drawing box
   CenterX           - horizontal distance of needle centre to top left corner of drawing box
   CenterY           - vertical distance of needle centre to top left corner of drawing box
   NeedleLength      - Length of the needle
   AngleNeedle       - Angle of the needle
   Texture           - Pointer to the background texture that should be restored
 */
void locNeedleBackgroundRestore(davehd_dev_t *Dev,
                                int PosX, int PosY,
                                int CenterX, int CenterY,
                                int NeedleLength,
                                float AngleNeedle,
                                const Img_t *Texture)
{
    int ret = 0;
    r_drw2d_Point_t l[2];
    double x, y;
    r_drw2d_LineStyle_t ls;

    x = (cosfCl(LOC_DEGREE(AngleNeedle)));
    y = (sinfCl(LOC_DEGREE(AngleNeedle)));
    x = (float)(PosX + CenterX) + x * ((float)NeedleLength); /* Changed from LOC_NEEDLE_CENTER_X */
    y = (float)(PosY + CenterY) - y * ((float)NeedleLength);


    l[0].X = R_DRW2D_2X(PosX + CenterX);
    l[0].Y = R_DRW2D_2X(PosY + CenterY);
    l[1].X = R_DRW2D_2X(x);
    l[1].Y = R_DRW2D_2X(y);
    ls.Width = R_DRW2D_2X(ClusterNeedle.Height);
    ls.IsClosed = 1;
    ls.LineCap = R_DRW2D_LINECAP_SQUARE;
    ls.LineJoin = R_DRW2D_LINEJOIN_NONE;
    ls.MiterLimit = R_DRW2D_2X(20);


    /* restore the rectangular area of the needle */
    /* calculate the needle outer point for the needle restoration */

    r_drw2d_Texture_t tmp_tex = demo_img2tex(Dev, Texture, 0);

    ret |= R_DRW2D_CtxIdentity(Dev->drw2d);
    ret |= R_DRW2D_CtxTextureSet(Dev->drw2d, 0, &tmp_tex);
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_SRC);
    ret |= R_DRW2D_CtxFillMode(Dev->drw2d, R_DRW2D_FILLMODE_TEXTURE);
    // locDebugSolidBackgroundPattern(); // This can create a solid background for debugging
    ret |= R_DRW2D_CtxLineStyle(Dev->drw2d, &ls);
    if (ret)
        R_PRINT_Log("error needle restore %d\n\r", ret);
    ret |= R_DRW2D_DrawLines(Dev->drw2d, l, 2);
    ret |= R_DRW2D_CtxFillMode(Dev->drw2d, R_DRW2D_FILLMODE_TEXTURE);

    if (ret)
        R_PRINT_Log("error needle 2 restore %d\n\r", ret);
}


