/*
   Render function to generate elements with background.

   Parameters:
   Dev        - D2D device structure
   Width      - Framebuffer width
   Height     - Framebuffer height
   Format     - Framebuffer format
 */
static void locElementSetupRender(davehd_dev_t *Dev)
{
    static char init = 1;
    const Img_t    *img;
    int i;
    r_drw2d_Framebuffer_t *cur_fb;
    r_drw2d_Texture_t fb_tex;
    int ret = 0;
    volatile static int element_array_size = LOC_ELEMENT_NUM;

    /* Background */
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_SRC);

    locBackGroundRestore(Dev, 0, 0, ClusterBackGround.Width,
                         ClusterBackGround.Height);

#if 1
    /* Render all icons */
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
    ret |= R_DRW2D_CtxBlendFactors(Dev->drw2d,
                                   R_DRW2D_BLEND_SRC_ALPHA, R_DRW2D_BLEND_ONE_MINUS_SRC_ALPHA,
                                   R_DRW2D_BLEND_ZERO, R_DRW2D_BLEND_ONE);
#else
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_SRC);
#endif

    for (i = 0; i < element_array_size; i++) {
        if (init) {
            img = locElement[i].OnImg;
        } else {
            img = locElement[i].OffImg;
        }
        if (img) {
            locElement_t *cur = &locElement[i];
            r_drw2d_Rect_t src_rect = demo_int2rect(        0,        0, img->Width, img->Height);
            r_drw2d_Rect_t dst_rect = demo_int2rect(cur->PosX, cur->PosY, img->Width, img->Height);
            r_drw2d_Texture_t tex = demo_img2tex(Dev, img, 0);
            ret |= R_DRW2D_CtxTextureSet(Dev->drw2d, 0, &tex);
            ret |= R_DRW2D_TextureBlit(Dev->drw2d, &src_rect, &dst_rect);
        }
    }

    /* Copy icons w/ background from frame buffer */
#if 0
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
    ret |= R_DRW2D_CtxBlendFactors(Dev->drw2d,
                                   R_DRW2D_BLEND_SRC_ALPHA, R_DRW2D_BLEND_ZERO,
                                   R_DRW2D_BLEND_ONE, R_DRW2D_BLEND_ZERO);
#else
    ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_SRC);
    /* ret |= R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
       ret |= R_DRW2D_CtxBlendFactors(Dev->drw2d,
       R_DRW2D_BLEND_ONE, R_DRW2D_BLEND_ZERO,
       R_DRW2D_BLEND_ONE, R_DRW2D_BLEND_ZERO); */
#endif
    /* get the current FB to restore it later. */
    cur_fb = demo_get_fb();
    fb_tex = demo_fb2tex(Dev, cur_fb, 0);
    ret |= R_DRW2D_CtxTextureSet(Dev->drw2d, 0, &fb_tex);

    for (i = 0; i < element_array_size; i++) {
        if (init) {
            img = locElement[i].OnImg;
        } else {
            img = locElement[i].OffImg;
        }
        if (img) {
            r_drw2d_Framebuffer_t tmp_fb = demo_img2fb(Dev, img);
            locElement_t             *cur = &locElement[i];
            r_drw2d_Rect_t src_rect = demo_int2rect(cur->PosX, cur->PosY, img->Width, img->Height);
            r_drw2d_Rect_t dst_rect = demo_int2rect(        0,        0, img->Width, img->Height);
            ret |= R_DRW2D_FramebufferSet(Dev->drw2d, &tmp_fb);
            ret |= R_DRW2D_TextureBlit(Dev->drw2d, &src_rect, &dst_rect);

            if (ret)
                R_PRINT_Log("error render elements\n");
        }
    }
    init = !init;

    /* restore the original framebuffer*/
    ret |= R_DRW2D_FramebufferSet(Dev->drw2d, cur_fb);
}

/*
   Test application render function.

   Parameters:
   Dev        - D2D device structure
   Width      - Framebuffer width
   Height     - Framebuffer height
   Format     - Framebuffer format
 */
void RenderClGaugeScreen(davehd_dev_t *Dev)
{
    if (locInit < 2) {
        R_DRW2D_CtxBgColor(Dev->drw2d, 0xffffffff);
        R_DRW2D_FramebufferClear(Dev->drw2d);
        /* This is an optimization, which leads to copy the icons instead of blending them. */
        locElementSetupRender(Dev);
    }

    /* Background */
    R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_SRC);
    if (locInit < 2) {
        locInit += 1;
        locBackGroundRestore(Dev, 0, 0, ClusterBackGround.Width,
                             ClusterBackGround.Height);
    } else {
        locBackGroundRestore(Dev, LOC_FGAUGE_POSX, LOC_FGAUGE_POSY,
                             LOC_FGAUGE_WIDTH, LOC_FGAUGE_HEIGHT);
        locBackGroundRestore(Dev, LOC_CGAUGE_POSX, LOC_CGAUGE_POSY,
                             LOC_CGAUGE_WIDTH, LOC_CGAUGE_HEIGHT);
    }
    /* Draw cluster icons, such as e.g. turn signals */
#if 1
    R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
    R_DRW2D_CtxBlendFactors(Dev->drw2d,
                            R_DRW2D_BLEND_SRC_ALPHA, R_DRW2D_BLEND_ONE_MINUS_SRC_ALPHA,
                            R_DRW2D_BLEND_ZERO, R_DRW2D_BLEND_ONE);
#endif

    locRenderElements(Dev);
    R_DRW2D_CtxBlendMode(Dev->drw2d, R_DRW2D_BLENDMODE_CUSTOM);
    R_DRW2D_CtxBlendFactors(Dev->drw2d,
                            R_DRW2D_BLEND_SRC_ALPHA, R_DRW2D_BLEND_ONE_MINUS_SRC_ALPHA,
                            R_DRW2D_BLEND_ZERO, R_DRW2D_BLEND_ONE);

    /* restore the Needle background, but only restore the pixels required */
    locNeedleSpeedRestore(Dev);
    locNeedleRPMRestore(Dev);

    /* Fuel + Cooling gauge */
    locFuelRender(Dev);
    locCoolingRender(Dev);

    /* RPM gauge */
    locNeedleRpmRender(Dev);

    /* Speed gauge */
    locNeedleSpeedRender(Dev);

    /* Count frames */
    locFrameCnt++;
}


