/* Setup video capturing. */
#ifdef TMP_VIDEO_CAPTURE
static void locSetupVideo(void)
{
    void *fb;

    locVideoSurface = VOAL_CreateSurface(1, VOAL_RGB565, LOC_VIDEO_BUF_X,
                                         LOC_VIDEO_BUF_Y, 10,
                                         LOC_VIDEO_BUF_WIDTH,
                                         LOC_VIDEO_BUF_WIDTH,
                                         LOC_VIDEO_BUF_HEIGHT, 255, 1, 0);
    VOAL_EnableSurface(locVideoSurface);
    /* Get framebuffer address of Surface after it was enabled.
       Otherwise NULL address (0x0) will be returned. */
    fb = VOAL_GetFrameBuffer(locVideoSurface);

 #ifdef USE_SAA71XX
    /* Setup video processor (SAA) */
    eeSAA71xx_Init(VIUNIT);
 #endif /* USE_SAA71XX */

    eeVi_DevInit(VIUNIT);
    eeVi_CapDisable(VIUNIT);

    eeVi_CapModeSet(VIUNIT, (eeVi_Mode_t)(EE_VI_MODE_YUV_ITU656 | EE_VI_MODE_YUV_Y_UV_INVERT | EE_VI_MODE_DATA_CLK_INVERT));
    /* capture to buffer Layer0: */
    eeVi_BufGeometrySetup(VIUNIT, fb, fb,
                          412,
                          LOC_VIDEO_WIDTH, LOC_VIDEO_HEIGHT,
                          0, 0, 0,
                          EE_VI_FB_FORMAT_RGB565,
                          0xff);
    eeVi_ImgScaleX(VIUNIT, LOC_VIDEO_BUF_WIDTH,  EE_VI_SCALING_SMALLER);
    eeVi_ImgScaleY(VIUNIT, LOC_VIDEO_BUF_HEIGHT, EE_VI_SCALING_SMALLER);

    eeVi_ErrCallbackSet(VIUNIT, locViErr);

    eeVi_CapEnable(VIUNIT);
}
#endif

/* Stop video capturing. */
#ifdef TMP_VIDEO_CAPTURE
static void locStopVideo(void)
{
    eeVi_CapDisable(VIUNIT);
    eeVi_DevDeInit(VIUNIT);
    VOAL_DisableSurface(locVideoSurface);
    VOAL_DeleteSurface(locVideoSurface);
 #ifdef USE_SAA71XX
    /* De-Init video processor (SAA) */
    eeSAA71xx_DeInit(VIUNIT);
 #endif /* USE_SAA71XX */
}
#endif


/*
   Section: Global Functions
 */

void GaugeScreenInit(davehd_dev_t *Dev)
{
    int i;

    locInit = 0;
    locFrameCnt = 0;

#ifdef TMP_VIDEO_CAPTURE
    locSetupVideo();
#endif
    locOldBackgroundData = Init2DImg(Dev, (Img_t *)&ClusterBackGround);
    locOldNeedleData = Init2DImg(Dev, (Img_t *)&ClusterNeedle);
    for (i = 0; i < LOC_ELEMENT_NUM; i++) {
        if (locElement[i].OnImg) {
            locElement[i].OnBackupData = Init2DImg(Dev, (Img_t *)locElement[i].OnImg);
        } else {
            locElement[i].OnBackupData = 0;
        }
        if (locElement[i].OffImg) {
            locElement[i].OffBackupData = Init2DImg(Dev, (Img_t *)locElement[i].OffImg);
        } else {
            locElement[i].OffBackupData = 0;
        }
    }

    /* reset needle angles to initial positions */
    locInitNeedlePosition(&NeedleRpm, locConvertRpm2Angle(CarModelRpmGet()));
    locInitNeedlePosition(&NeedleSpeed, locConvertSpeed2Angle(CarModelSpeedGet()));

    One_Div_BackgroudW_F = 1.0f / (ClusterBackGround.Width * 1.0f);
    One_Div_BackgroudH_F = 1.0f / (ClusterBackGround.Height * 1.0f);
    One_Div_BackgroudW_F2 = One_Div_BackgroudW_F / 2.0f;
    One_Div_BackgroudH_F2 = One_Div_BackgroudH_F / 2.0f;

    One_Div_NeedleW_F = 1.0f / (ClusterNeedle.Width * 1.0f);
    One_Div_NeedleH_F = 1.0f / (ClusterNeedle.Height * 1.0f);
}

void GaugeScreenDeInit(davehd_dev_t *Dev)
{
    int i;

    for (i = 0; i < LOC_ELEMENT_NUM; i++) {
        if (locElement[i].OnImg) {
            Deinit2DImg(Dev, (Img_t *)locElement[i].OnImg, locElement[i].OnBackupData);
        }
        if (locElement[i].OffImg) {
            Deinit2DImg(Dev, (Img_t *)locElement[i].OffImg, locElement[i].OffBackupData);
        }
    }
    Deinit2DImg(Dev, (Img_t *)&ClusterNeedle, locOldNeedleData);
    Deinit2DImg(Dev, (Img_t *)&ClusterBackGround, locOldBackgroundData);
#ifdef TMP_VIDEO_CAPTURE
    locStopVideo();
#endif
}

dhd_pixel_org_t ImageFormat_to_dhdorg(Img_ColourFormat_t imageFormat)
{
    dhd_pixel_org_t org = 0;

    switch (imageFormat) {
    case IMG_ARGB8888: org = E_DHD_TEXEL_ORG_ARGB_8888; break;
    case IMG_ALPHA8: org = E_DHD_TEXEL_ORG_AL_8;      break;
    case IMG_RGB565: org = E_DHD_TEXEL_ORG_RGB_565;   break;
    case IMG_ARGB1555: org = E_DHD_TEXEL_ORG_ARGB_1555; break;
    case IMG_RGB888: org = E_DHD_PIXEL_ORG_ARGB_8888_PRE;     break;
    /*case IMG_MODE_RLE : org = E_DHD_TEXEL_ORG_RGBA_8888; break;*/
    default: break;
    }
    return org;
}

dhd_bool_t Image_HasAlpha(Img_ColourFormat_t imageFormat)
{
    dhd_bool_t ret = 0;

    switch (imageFormat) {
    case IMG_ARGB8888: ret = 1;  break;
    case IMG_ALPHA8: ret = 1;  break;
    case IMG_RGB565: ret = 0;  break;
    case IMG_ARGB1555: ret = 1;  break;
    case IMG_RGB888: ret = 0;  break;
    /*case IMG_MODE_RLE : org = 0; break;*/
    default: break;
    }
    return ret;
}
